import React from "react";

// Imported Images (Need to change these images to desired ones)
import background from './images/bg/background_option_2.png'; // Background image

const Home = () => {

	return (
		<body>
		
		{/* Start Hero */}
		<section class="bg-half-260 d-table w-100" style={{backgroundImage: "url(" + background + ")"}}>	
			<div class="bg-overlay bg-gradient-primary opacity-9"></div>
			<div class="container">
				<div class="row align-items-center mt-5">
					<div class="col-lg-5 col-md-6">
						<div class="title-heading">
							<h4 class="display-4 fw-bold text-white title-dark mb-4">3DPrintable:</h4> 
							<p class="text-white-50 para-desc">The first purely dedicated NFT marketplace for 3D printable goods.</p>
						</div>
					</div>
				</div>
			</div>
    	</section>
		{/* End Hero */}

		{/* Start Our Vision */}
		<section class="section">
			<div class="container mt-100 mt-60">
				<div class="row justify-content-center">
						<div class="col-12">
								<div class="section-title text-center mb-4 pb-2">
										<h6 class="text-primary">Our Vision</h6>
										<h4 class="title mb-3 mt-2">Connecting the 3D printing and blockchain industries.</h4>
								</div>
						</div>
				</div>
			</div>
		</section>
		{/* End Our Vision */}

	</body>
	);
}

export default Home;
